import React from "react";
import { useHistory } from "react-router-dom";


const Logout = () => {
    const history = useHistory();

    const onSubmitDelete = () => {
        localStorage.clear();
        history.push("/login");
    }

    return(
        <div>
            <button onClick={ () => onSubmitDelete } >Logout</button>
        </div>
    )
}



export default Logout;
